import React, { useState, useEffect } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  IconButton,
  Menu,
  MenuItem,
  Autocomplete,
  TextField,
  MenuItem as SelectItem,
  Switch,
  CircularProgress
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import ClearIcon from '@mui/icons-material/Clear';
import { Link, useNavigate } from 'react-router-dom';
import productos from '../../data/productos.json';
import { FormControlLabel } from '@mui/material';

export default function Navbar() {
  const navigate = useNavigate();

  const [anchorElProd, setAnchorElProd] = useState(null);
  const handleOpenProductos = (e) => setAnchorElProd(e.currentTarget);
  const handleCloseProductos = () => setAnchorElProd(null);

  const [anchorElPais, setAnchorElPais] = useState(null);
  const [paisSeleccionado, setPaisSeleccionado] = useState("Ecuador");
  const handleOpenPais = (e) => setAnchorElPais(e.currentTarget);
  const handleClosePais = () => setAnchorElPais(null);
  const cambiarPais = (pais) => {
    setPaisSeleccionado(pais);
    handleClosePais();
  };

  // Estado buscador
  const nombres = productos.map(p => p.nombre);
  const [nombre, setNombre] = useState('');
  const [categoria, setCategoria] = useState('');
  const [disponible, setDisponible] = useState(false);
  const [resultados, setResultados] = useState([]);
  const [cargando, setCargando] = useState(false);

  useEffect(() => {
    setCargando(true);
    const timer = setTimeout(() => {
      const filtrados = productos.filter(p => {
        const matchNombre = nombre ? p.nombre.toLowerCase().includes(nombre.toLowerCase()) : true;
        const matchCat = categoria ? p.categoria === categoria : true;
        const matchDisp = disponible ? p.disponible : true;
        return matchNombre && matchCat && matchDisp;
      });
      setResultados(filtrados);
      setCargando(false);
    }, 400);
    return () => clearTimeout(timer);
  }, [nombre, categoria, disponible]);

  const limpiar = () => {
    setNombre('');
    setCategoria('');
    setDisponible(false);
    setResultados([]);
  };

  const irADetalle = (e, value) => {
    const producto = productos.find(p => p.nombre === value);
    if (producto) navigate(`/productos/detalle/${producto.id}`);
  };

  return (
    <>
      <AppBar position="fixed" sx={{ bgcolor: '#2e7d32' }}>
        <Toolbar sx={{ display: 'flex', justifyContent: 'space-between', flexWrap: 'wrap' }}>
          {/* Logo / Título */}
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
            <IconButton edge="start" color="inherit">
              <MenuIcon />
            </IconButton>
            <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
              <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
                🌾 Mercado Agrícola
              </Typography>
            </Link>
          </Box>

          {/* Botones institucionales */}
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 3, flexWrap: 'wrap' }}>
            <Button color="inherit" onClick={() => navigate('/nosotros')}>Nosotros</Button>
            <Button color="inherit" onClick={handleOpenProductos} endIcon={<ExpandMoreIcon />}>Productos</Button>
            <Menu
              anchorEl={anchorElProd}
              open={Boolean(anchorElProd)}
              onClose={handleCloseProductos}
              disableScrollLock
              PaperProps={{ sx: { bgcolor: '#e8f5e9', borderRadius: 2 } }}
            >
              <MenuItem onClick={() => navigate('/productos/agricola')}>Agrícola</MenuItem>
              <MenuItem onClick={() => navigate('/productos/mascotas')}>Mascotas</MenuItem>
              <MenuItem onClick={() => navigate('/productos/quimicos')}>Químicos</MenuItem>
              <MenuItem onClick={() => navigate('/productos/semillas')}>Semillas</MenuItem>
            </Menu>

            <Button color="inherit" onClick={() => navigate('/servicios')}>Servicios en línea</Button>

            {/* Selector de país */}
            <Button color="inherit" onClick={handleOpenPais} endIcon={<ExpandMoreIcon />}>
              País: {paisSeleccionado}
            </Button>
            <Menu
              anchorEl={anchorElPais}
              open={Boolean(anchorElPais)}
              onClose={handleClosePais}
              disableScrollLock
              PaperProps={{ sx: { bgcolor: '#f1f8e9', borderRadius: 2 } }}
            >
              <MenuItem onClick={() => cambiarPais('Ecuador')}>🇪🇨 Ecuador</MenuItem>
              <MenuItem onClick={() => cambiarPais('Perú')}>🇵🇪 Perú</MenuItem>
              <MenuItem onClick={() => cambiarPais('Colombia')}>🇨🇴 Colombia</MenuItem>
              <MenuItem onClick={() => cambiarPais('México')}>🇲🇽 México</MenuItem>
            </Menu>

            {/* Buscador avanzado */}
            <Box sx={{
              display: 'flex',
              alignItems: 'center',
              gap: 1,
              flexWrap: 'wrap',
              bgcolor: '#ffffff33',
              p: 1,
              borderRadius: 3,
              minWidth: 300
            }}>
              <Autocomplete
                freeSolo
                disableClearable
                options={nombres}
                value={nombre}
                onInputChange={(e, val) => setNombre(val)}
                onChange={irADetalle}
                sx={{ flexGrow: 1, minWidth: 180 }}
                renderInput={(params) => (
                  <TextField
                    {...params}
                    label="Buscar producto"
                    InputProps={{
                      ...params.InputProps,
                      type: 'search'
                    }}
                    size="small"
                  />
                )}
              />

              <TextField
                select
                value={categoria}
                onChange={(e) => setCategoria(e.target.value)}
                label="Categoría"
                size="small"
                sx={{ minWidth: 150 }}
              >
                <SelectItem value="">Todas</SelectItem>
                <SelectItem value="Alimento Perro">Alimento Perro</SelectItem>
                <SelectItem value="Alimento Gato">Alimento Gato</SelectItem>
                <SelectItem value="Limpieza Y Aseo">Limpieza Y Aseo</SelectItem>
                <SelectItem value="Jardinería">Jardinería</SelectItem>
              </TextField>

              <FormControlLabel
                control={
                  <Switch
                    checked={disponible}
                    onChange={(e) => setDisponible(e.target.checked)}
                    color="success"
                  />
                }
                label="Disponibles"
              />

              <IconButton onClick={limpiar} title="Limpiar filtros">
                <ClearIcon />
              </IconButton>
            </Box>
          </Box>
        </Toolbar>
      </AppBar>

      {/* Espaciador */}
      <Box sx={{ height: '70px', mb: 1 }} />

      {/* Resultados visibles abajo si estás en PantallaInicio */}
      {cargando ? (
        <Box sx={{ textAlign: 'center', mt: 2 }}>
          <CircularProgress color="success" />
        </Box>
      ) : resultados.length > 0 ? (
        <Typography sx={{ textAlign: 'center', mt: 2 }}>
          Resultados encontrados: <strong>{resultados.length}</strong>
        </Typography>
      ) : nombre && (
        <Typography sx={{ textAlign: 'center', mt: 2, color: '#d32f2f' }}>
          No se encontraron productos con esos filtros.
        </Typography>
      )}
    </>
  );
}
